            IF (SELECT COUNT(*) FROM parkfulldatetime 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00')) = 0 THEN
                INSERT INTO parkfulldatetime (Year, Month, Hour, Banias, Herodium, Masada) 
                VALUES (YEAR(CURDATE()), MONTH(CURDATE()), CONCAT(HOUR(CURTIME()), ':00:00'), 1, 0, 0);
            ELSE
                UPDATE parkfulldatetime 
                SET Banias = Banias + 1 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00');
            END IF;
        END IF;
        
        -- For Herodium
        IF NEW.ParkId = 3 THEN
            IF (SELECT COUNT(*) FROM parkfulldatetime 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00')) = 0 THEN
                INSERT INTO parkfulldatetime (Year, Month, Hour, Banias, Herodium, Masada) 
                VALUES (YEAR(CURDATE()), MONTH(CURDATE()), CONCAT(HOUR(CURTIME()), ':00:00'), 0, 1, 0);
            ELSE
                UPDATE parkfulldatetime 
                SET Herodium = Herodium + 1 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00');
            END IF;
        END IF;
        
        -- For Masada
        IF NEW.ParkId = 2 THEN
            IF (SELECT COUNT(*) FROM parkfulldatetime 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00')) = 0 THEN
                INSERT INTO parkfulldatetime (Year, Month, Hour, Banias, Herodium, Masada) 
                VALUES (YEAR(CURDATE()), MONTH(CURDATE()), CONCAT(HOUR(CURTIME()), ':00:00'), 0, 0, 1);
            ELSE
                UPDATE parkfulldatetime 
                SET Masada = Masada + 1 
                WHERE Year = YEAR(CURDATE()) AND Month = MONTH(CURDATE()) AND Hour = CONCAT(HOUR(CURTIME()), ':00:00');
            END IF;
        END IF;
    END IF;
