/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `preorders_AFTER_UPDATE` AFTER UPDATE ON `preorders` FOR EACH ROW BEGIN
  -- Update the notificationSentTime when the status changes to "Notify"
  IF OLD.OrderStatus = 'In Waiting List' AND NEW.OrderStatus = 'Notified Waiting List' THEN
    UPDATE waitinglist
    SET notificationSentTime = CURRENT_TIMESTAMP
    WHERE orderId = NEW.OrderId;
  END IF;

  -- Delete the record if the status changes to "Cancelled" or "Irrelevant"
  IF (OLD.OrderStatus = 'In Waiting List' OR OLD.OrderStatus = 'Notified Waiting List') AND (NEW.OrderStatus = 'Cancelled' OR NEW.OrderStatus = 'Irrelevant' OR NEW.OrderStatus = 'Confirmed') THEN
    DELETE FROM waitinglist WHERE orderId = NEW.OrderId;
  END IF;

    IF OLD.OrderStatus = 'Confirmed' AND NEW.OrderStatus = 'In Park' THEN
    UPDATE parks
    SET CurrentInPark = CurrentInPark + NEW.Amount
    WHERE ParkId = NEW.ParkId;
  END IF;

    IF OLD.OrderStatus = 'In Park' AND NEW.OrderStatus = 'Completed' THEN
    UPDATE parks
    SET CurrentInPark = CurrentInPark - OLD.Amount
    WHERE ParkId = OLD.ParkId;
  END IF;

END */;;
DELIMITER ;
